import { BiCalendar } from "react-icons/fc";
import { BiAlarm } from "react-icons/fc";
import { BiEdit } from "react-icons/fc";
import { HiTrash } from "react-icons/hi";

const Todo = () => {
  return (
    <div className="w-full bg-gray-100 rounded-lg flex flex-col items-center justify-center p-3">
      <div className="flex items-center justify-between w-full">
        <div className="w-[15%]">
          <div className="w-6 h-6 bg-blue-500 flex items-center justify-center">
            <HiTrash className="cursor-pointer" />
          </div>
        </div>
        <div className="w-[85%] flex justify-end overflow-x-scroll">
          <span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans mr-2">School</span>
          <span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans mr-2">Everyday</span>
          <span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans mr-2">Works</span>
          {/*<span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans mr-2">Activity</span>
          <span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans mr-2">Lifestyle</span>
          <span className="border border-gray-500 px-2 rounded-full select-none text-md font-sans mr-2">Home</span>*/}
        </div>
      </div>

    </div>
  );
}

export default Todo;
